import React from 'react';
import {Panel, PanelGroup} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';

export type FaqVProps= {
  faqData?:any[];
}

const faqData = [{
  "Question":"how are you",
  "Answer":"answer"
},
{
  "Question":"hey this is FAQ",
  "Answer":"this is answer"
}


]


const faqV = (props:FaqVProps)=> {
  const output:any =[];
  const getFaq = () => {
    Array.isArray(faqData) && faqData.forEach(items=>{
      output.push(
          <Panel header={items.Question}>
           {items.Answer}
          </Panel>

      )
    });
    return output
  }



  return (

  <PanelGroup accordion bordered>
    {getFaq()}
  </PanelGroup>
  )
}

export default faqV
